import axios from 'axios';

export default async function Signup(name, email, password) {
  url = 'http://localhost:3000/signup';
  try {
    const response = await axios.post(url, {
      name: name,
      email: email,
      password: password
    });
    console.log(response);
  } catch (error) {
    console.log(error);
  }
}
